    return (
        <Container fluid >
            <div className="header_section" >
                <img src={logo} className="logoDisplay" style={{ width: '125px' }} />
                <div  className="header_sub_section">
                    <p className="side_intro"><span><IoIosCall size={25} /></span> Have any question?<br />Free: +12 365 5233  </p>
                    <p className="side_intro"><span><IoIosCall size={25} /></span> Have any question?<br />Free: +12 365 5233  </p>
                </div>

            </div>

            <hr style={{ color: "#c1c1c1" }}></hr>

        </Container>
    );
}

